query:
PREFIX ns4: <http://www.wikidata.org/entity/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX ns1: <http://www.w3.org/ns/shacl#>

ASK WHERE {
  ns4:Q243 (ns1:property/rdf:rest*/rdf:first)* ns4:Q90 .
}

PREFIX ns3: <http://dbpedia.org/ontology/>

SELECT (COUNT(?person) AS ?numberOfPeople)
WHERE {
  ?person a ns3:CollegeStudent ;
          ns3:attendsUniversity ?university .
  ?university ns3:location ?location .
  ?location ns3:isInState <http://dbpedia.org/resource/California> .
}

PREFIX ns5: <http://schema.org/>
PREFIX ns3: <http://dbpedia.org/ontology/>

ASK WHERE {
  ?series a ns3:NovelShape ;
          ns5:author "J.K. Rowling" ;
          ns5:name "Harry Potter" .
}

PREFIX ns3: <http://dbpedia.org/ontology/>

SELECT ?country WHERE {
  ?river ns3:sourceCountry ?country .
  FILTER (?river = <http://dbpedia.org/resource/Amazon_River>)
}

SELECT (COUNT(?movie) AS ?numMovies) 
WHERE {
  ?movie a <http://schema.org/Movie> .
  ?movie <http://schema.org/director> <http://www.wikidata.org/entity/Q25169> .
}

PREFIX ns1: <http://www.w3.org/ns/shacl#>
PREFIX ns3: <http://dbpedia.org/ontology/>

ASK WHERE {
  ?journal a ns3:IEEEIntelligentSystemsJournalShape ;
           ns3:subject ?subject .
  FILTER (CONTAINS(LCASE(STR(?subject)), "inteligencia artificial"))
}

PREFIX ns4: <http://www.wikidata.org/entity/>
PREFIX ns1: <http://www.w3.org/ns/shacl#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX ns3: <http://dbpedia.org/ontology/>

ASK WHERE {
  ?nation rdf:type ns4:Q30 ;  # Assuming `ns4:Q30` is the entity for the United States
          ns1:property ?anthem .
  ?anthem rdf:type ns3:MusicalWork ;
          ns3:workTitle "The Star-Spangled Banner"@en .
}

PREFIX ns4: <http://www.wikidata.org/entity/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

ASK WHERE {
  ns4:Q16266334Shape rdf:type ns4:Q1353183Shape .
}

PREFIX ns4: <http://www.wikidata.org/entity/>

ASK {
  ns4:Q35298 ns4:P800 ns4:Q5131334 .
}

PREFIX ns3: <http://dbpedia.org/ontology/>
PREFIX ns4: <http://www.wikidata.org/entity/>

ASK {
  ns4:Q3520 ns3:party ?party .
  ns4:Q180095 ns3:party ?party .
}

PREFIX ns4: <http://www.wikidata.org/entity/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

ASK WHERE {
  ?movie rdf:type ns4:Q11303Shape . # Harry Potter movies
  ?movie ?property ns4:Q16266334Shape . # Emma Watson
}

PREFIX ns3: <http://dbpedia.org/ontology/>

SELECT (COUNT(?bird) AS ?birdCount)
WHERE {
  ?bird a ns3:BirdShape .
  ?bird ns3:phylum ns3:Chordate .
}

PREFIX ns4: <http://www.wikidata.org/entity/>

ASK WHERE {
  ns4:Q19675 ns4:P131 ns4:Q90 .
}

ASK WHERE {
  ?museum a <http://schema.org/Museum> ;
          <http://schema.org/name> "Musée du Louvre"@fr ;
          <http://schema.org/location> ?location .
  ?location <http://schema.org/name> "Paris"@fr .
}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>

SELECT (COUNT(?book) AS ?numberOfBooks) WHERE {
  ?book wdt:P50 wd:Q34660.
}

PREFIX ns3: <http://dbpedia.org/ontology/>

ASK WHERE {
  ?university a ns3:CollegeShape .
  ?university ns3:PropertyNameUsedForLocation1 [ ns3:name "Nueva York" ] .
  ?university ns3:PropertyNameUsedForLocation2 [ ns3:name "California" ] .
}
